          "tree_id": "efe9e9d20203b5a230b28e64799f3b9e33d9b6d2",
          "distinct": true,
          "message": "Refactor memory wrappers (#2335)\n\nThis commit significantly reworks the CUDA.jl memory wrappers.\r\n\r\nThe low-level driver wrappers have been moved out of the Mem submodule,\r\nand for consistency with Base the Buffer name has been replaced by\r\nMemory. This is mostly an NFC change, and deprecations have been added\r\nto make this non-breaking.\r\n\r\nThe high-level wrappers have been changed to to introduce a Managed\r\nlayer, i.e., CuArray now container a `DataRef` (from GPUArrays, for\r\nrefcounting), which contains a new `Managed`, which contains an\r\n`AbstractMemory` subtype. The purpose of the `Managed` struct is to keep\r\ntrack of the state of the memory, specifically, which stream has last\r\nmodified it, and whether there's outstanding asynchronous operations.\r\nThis information is used synchronize the memory when deriving a pointer,\r\nmaking it possible to avoid explicit synchronization in many cases\r\n(notably, when switching tasks or devices).\r\n\r\nSadly, this approach is not water-tight, notably, when memory is\r\ncaptured (e.g. as part of a CUDA graph) we may not hit the pointer\r\nderivation path and thus fail to synchronize. Explicit synchronization\r\nis still required here, or an explicit copy to CPU memory (in which case\r\nCUDA.jl will always synchronize).\r\n\r\nAs part of this change, several bugs and other minor issues were\r\ndiscovered and fixed. Refer to the GitHub PR for an un-squashed version\r\nof these changes for more details.",
          "id": "eb45b2c1c6b5d24f39c0e045198eba389f51405b",
          "timestamp": "2024-04-24T10:21:07+02:00",
          "url": "https://github.com/JuliaGPU/CUDA.jl/commit/eb45b2c1c6b5d24f39c0e045198eba389f51405b"
