          "distinct": true,
          "message": "Handle cache improvements (#2352)\n\nRework the handle cache so that handle ctors are dtors are known to the\r\ncache. This makes it possible for it to evict handles at any time, and is\r\nused to wipe handles when reclaiming memory.\r\n\r\nAlso switch to a spinlock to ensure safe operation in finalizers,\r\nand consider collecting memory when allocating new handles.",
